        "content": "## 使用说明\n\n1. 复制此谷歌表格 https://docs.google.com/spreadsheets/d/10hSuGOOf14YvVY2Bw8WXUIpsyXO614l7qNEjkyVY_Qg/edit?usp=sharing\n\n2. 配置谷歌服务凭证并添加以下权限范围 `https://www.googleapis.com/auth/webmasters, https://www.googleapis.com/auth/webmasters.readonly, https://www.googleapis.com/auth/adwords`\n\n3. 将域名替换为您需要的目标域名\n\n\n1. **理解工作流程：**\n- **节点概览：**\n本工作流包含多个节点：\n- **设置域名：** 指定查询使用的域名。\n- **计划触发器：** 按预设时间表启动工作流。\n- **HTTP请求（查询/页面/日期）：** 通过指定维度和日期从谷歌搜索控制台API获取数据。\n- **数据拆分（x3）：** 将JSON数组拆分为独立条目供后续处理。\n- **字段编辑（x3）：** 映射输出数据到指定字段，为写入谷歌表格做准备。\n- **谷歌表格（x3）：** 将获取的数据添加或更新到指定谷歌表格文档。\n\n- **输入输出：**\n- 输入：来自谷歌搜索控制台的API响应（含关键词/页面数据/日期数据）。\n- 输出：写入谷歌表格的条目（含关键词数据/点击量/展现量/点击率/排名）。\n\n2. **配置指南：**\n- **先决条件：**\n- 已安装运行n8n实例\n- 可访问谷歌搜索控制台和谷歌表格的有效账户\n- 用于API访问的谷歌OAuth 2.0凭证\n\n- **逐步设置：**\n1. 打开n8n创建新工作流\n2. 按JSON描述添加节点\n3. 在n8n中配置**谷歌OAuth2**凭证启用API访问\n4. 在**设置域名**节点指定域名\n5. 将谷歌表格文档URL替换为个人表格链接\n6. 按需调整**计划触发器**节点的时间表\n7. 保存工作流\n\n- **配置选项：**\n- 可在**HTTP请求**节点主体中自定义日期范围\n- 根据数据需求调整**字段编辑**节点中的映射字段\n\n3. **应用场景示例：**\n- 长期追踪网站搜索表现指标\n- 适合数字营销人员/SEO专家/网站分析师\n- 为利益相关者或团队评估生成表现报告\n\n4. **运行与故障排除：**\n- **执行工作流：**\n- 手动触发或等待计划任务自动运行\n\n- **运行监控：**\n- 通过n8n面板检查执行日志确保所有节点完成\n\n- **常见问题：**\n- OAuth凭证无效 → 检查凭证配置\n- 谷歌表格URL错误 → 核对文档链接和权限\n- 计划冲突 → 确保时间表与其他工作流无重叠"
